import { Text, View, StyleSheet } from "react-native";
import { AntDesign, Ionicons } from "@expo/vector-icons";
export default function MenuList() {
  return (
    <>
      <View style={styles.container}>
        <View style={styles.contentLeft}>
          <AntDesign
            style={styles.iconBack}
            name="back"
            size={17}
            color="black"
          />
          <Text style={styles.textLeft}>Miễn phí trả hàng</Text>
        </View>
        <View style={styles.contentCenter}>
          <Ionicons
            name="ios-shield-checkmark-outline"
            size={17}
            color="black"
          />
          <Text style={styles.textCenter}>Chính hãng 100%</Text>
        </View>
        <View style={styles.contentRight}>
          <Ionicons name="ios-cart-outline" size={17} color="black" />
          <Text style={styles.textRight}>Giao hàng miễn phí</Text>
        </View>
      </View>
    </>
  );
}

const styles = StyleSheet.create({
  container: {
    width: "100%",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
  },
  contentLeft: {
    flex: 1,
    alignItems: "center",
    flexDirection: "row",
  },
  textLeft: {
    fontSize: 12,
  },
  contentCenter: {
    flex: 1,
    alignItems: "center",
    flexDirection: "row",
  },
  textCenter: {
    fontSize: 12,
  },
  contentRight: {
    flex: 1,
    alignItems: "center",
    justifyContent: "space-around",
    flexDirection: "row",
  },
  textRight: {
    fontSize: 12,
  },
});
